The invention further relates to a method for preparing a polypeptide comprising:
(a) providing an amino acid sequence of a parent polypeptide having amylase activity;
(b) selecting one or more amino acids occupying one or more positions corresponding to positions 195, 197, 198, 200, 203, 206, 210, 212, 213, 243 and further selecting one or more position corresponding to positions 116, 118, 129, 133, 142, 146, 147, 149, 151, 152, 169, 174, 186, 235, 244, 303, 320, 339, 359, 418, 431, 434, 447, 458 of the mature polypeptide of SEQ ID NO:6;
(c) modifying the sequence by substituting or deleting the selected amino acid residue or inserting one or more amino acid residues adjacent to the selected amino acid residue;
(d) producing a variant polypeptide having the modified sequence;
(e) testing the variant polypeptide for amylase activity and stability; and
(f) selecting a variant polypeptide having amylase activity and increased stability relative to the parent polypeptide in the presence of a chelating agent wherein said chelating agent at a concentration below 10 mM is capable of reducing the concentration of free calcium ions from 2.0 mM to 0.10 mM at 21° C. and pH 8.0.

Alternatively one or more alternative amino acid residues may be inserted in a given position it is indicated as:
A30 [N, E] or A30 [N E], alternatively A30 {N, E} or A30 {N E}
For simplicity alternative amino acid which could be substituted at a certain position may be indicated as:

Thus another aspect the invention relates to a method for preparing a polypeptide comprising;
(a) providing an amino acid sequence of a parent polypeptide having amylase activity;
(b) selecting one or more amino acid which occupies one or more position corresponding to positions 195, 197, 198, 200, 203, 206, 210, 212, 213, 243, and further selecting one or more position corresponding to positions 116, 118, 129, 133, 134, 142, 146, 147, 149, 151, 152, 169, 174, 186, 235, 244, 303, 320, 339, 359, 418, 431, 434, 447, 458 of the mature polypeptide of SEQ ID NO: 6;
(c) modifying the sequence by substituting or deleting the selected amino acid residue or inserting one or more amino acid residues downstream and adjacent to the selected amino acid residue;
(d) producing a variant polypeptide having the modified sequence;
(e) testing the variant polypeptide for amylase activity and stability; and
(f) selecting a variant polypeptide having amylase activity and increased stability relative to the parent polypeptide in the presence of a chelating agent wherein said chelating agent at a concentration below 10 mM is capable of reducing the concentration of free calcium ions from 2.0 mM to 0.10 mM at 21° C. and pH 8.0.

